import React from 'react';
import '../container/assignmentQna.css';
import UploadForm from './UploadForm';
import FileList from './FilesList';

function AssignmentQNA({ role }) {
  return (
    <div className='qna'>
      <h1>Assignment Section</h1>
      <div className='qna_div'>
        <div className='get_question'>
          <p>See Your Problems Here</p>
          <FileList type="questions" />
        </div>
        {role === 'user' && (
          <div className='upload_section'>
            <p>Upload Your Assignment</p>
            <UploadForm type="answers" />
            <FilesList type="answers" />
          </div>
        )}
        {role === 'moderator' && (
          <div className='upload_section'>
            <p>Upload Question File</p>
            <UploadForm type="questions" />
            <p>See Uploaded Answers</p>
            <FilesList type="answers" />
          </div>
        )}
      </div>
    </div>
  );
}

export default AssignmentQNA;
